export default function WasteDisplay({ data }) {
    if (!data) {
      return <p>No data available</p>;
    }

    return (
      <div style={{ padding: "20px", maxWidth: "400px", margin: "auto", border: "1px solid #ccc", borderRadius: "10px", boxShadow: "2px 2px 12px rgba(0,0,0,0.1)" }}>
        <h2 style={{ fontSize: "20px", fontWeight: "bold", marginBottom: "15px" }}>Waste Report</h2>
        {data.image && <img src={URL.createObjectURL(data.image)} alt="Uploaded Waste" style={{ width: "100%", borderRadius: "5px" }} />}
        <p><strong>Address:</strong> {data.address}</p>
        <p><strong>Estimated Quantity:</strong> {data.quantity} kg</p>
        {data.location?.lat && data.location?.lng && (
          <p><strong>Location:</strong> {data.location.lat}, {data.location.lng}</p>
        )}
      </div>
    );
  }
